def simulate_model(trial_data, alpha=1, beta=1):
    utility_values = []
    for trial in trial_data:
        try:
            splitperc_self = trial["splitperc_self"]
            token_self = trial["token_self"]
            token_opp = trial["token_opp"]

            #Handle division by zero
            if token_self + token_opp == 0:
                fairness_threshold = 50 #Default to 50% if both tokens are zero
            else:
                fairness_threshold = beta * (token_self / (token_self + token_opp) * 100)

            utility = alpha * (splitperc_self - fairness_threshold)
            utility_values.append(utility)
        except (KeyError, TypeError) as e:
            print(f"Error processing trial {trial.get('ID', 'N/A')}: {e}")
            utility_values.append(float('nan')) #Handle missing data gracefully

    return utility_values
